    const apiGet = ()=>{
        axios.get('http://localhost:1337/api/notice')
        .then((response) =>{
            const allData=response.data.user;
            setData(allData)
        })
        .catch(error=>console.error(`error:${error}`));
    }


    return (

        <div>
            {data}
    </div>
    )
}

